insert into models(id, readable_id, display_name, description, category_id, image_list_id,
                   parameter_list_ids)
values ('e5bc1852-0599-42cd-85b1-56c076fee484'::uuid, 'kreslo', 'Автокресло',
        E'\nАвтокресло представлено в 2 размерах: S и М\n\nМатериал автокресел: качественный и крепкий Оксфорд\n\nАвтокресло оснащено тугими кнопками, обеспечивающими полную безопасность вашего любимца\n\nВо время езды автокресло пристегивается к машинному сиденью с помощью специального ремня.\n\nЛюбимец также пристегивается к автокреслу за шлейкой с помощью небольшого ремня.\n\nАвтокресло подойдет для перевозок на близкие и дальние расстояния\n',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, '83b6f1fb-65a4-422f-b327-732e302881d9'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'f9f1f47a-023b-41b7-844f-49a03044a384'::uuid]),
       ('1a12d4a8-d4c9-409f-ab26-f0677c8bed2f'::uuid, 'kolorado', 'Колорадо',
        E'\nТкань, фурнитура, наполнители:\n  - мебельная ткань микрофибра\n  - плотность ткани: 370г/м2\n  - тест на стирание по Мартиндейлу – 50 000 циклов\n  - цветостойкость: 5 (макс 5)\n  - ткань прошита армированными нитями\n  - борта и матрас наполнены гипоаллергенным и антибактериальным холлофайбером\n  - водоотталкивающая ткань\n\nХарактеристики: \n - лежак не боится воды\n - аккуратные, мягкие бортики, на которые любимец может положить голову\n - чехол, который можно стирать в стиральной машине\n - съемная подушка\n',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, '72d9edf5-1a74-45fe-a93c-b7293ad2eda0'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'a04a122d-d2e7-4b64-97f1-4a6798b0b247'::uuid]),
       ('06322df6-579a-487a-9144-6319ad223c18'::uuid, 'norka', 'Норка',
        E'\nТкань, фурнитура, наполнители:\n  - мебельная ткань микрофибра\n  - плотность ткани: 370г/м2\n  - тест на стирание по Мартиндейлу – 50 000 циклов\n  - цветостойкость: 5 (макс 5)\n  - ткань прошита армированными нитями\n  - лежак наполнен гипоаллергенным и антибактериальным холлофайбером, основа из мебельного паролона\n  - водоотталкивающая ткань\n  - 25% шерсть\n',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, 'e58c830f-fb8d-4597-8878-9d2b81e72b14'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'a04a122d-d2e7-4b64-97f1-4a6798b0b247'::uuid]),
       ('c0f17606-3349-4e53-b5c6-4111da96168f'::uuid, 'podushka', 'Подушка',
        E'\nТкань, фурнитура, наполнители:\n  - мебельная ткань микрофибра\n  - тест на стирание по Мартиндейлу – 30 000 циклов\n  - цветостойкость: 4 (макс 5)',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, '661c0259-0d85-4f2a-b756-42b511d87d06'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'fcf6e107-c711-49a1-85db-cdea5f387b0e'::uuid]),
       ('4f811203-5ddf-46b3-b18e-a38ac4687218'::uuid, 'chemodan', 'Чемодан',
        E'\nТкань, фурнитура, наполнители:\n - ткань прошита армированными нитями\n - матрас наполнен гипоаллергенным и антибактериальным холлофайбером и синтепоном.\n - водоотталкивающая ткань\n',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, '38e74949-5807-475a-a5cd-c8cd72c51c8e'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'a04a122d-d2e7-4b64-97f1-4a6798b0b247'::uuid]),
       ('41e74a6b-cbb3-45d6-97c6-2814e0ef71fb'::uuid, 'kvadroSoft', 'Квадро Софт',
        E'\nТкань, фурнитура, наполнители:\n - ткань прошита армированными нитями\n - матрас наполнен гипоаллергенным и антибактериальным холлофайбером.\n - водоотталкивающая ткань\n\nХарактеристики: \n - лежак не боится воды\n - аккуратные, мягкие бортики, на которые любимец может положить голову\n - чехол, который можно стирать в стиральной машине\n - съемная подушка\n',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, 'fdaacd67-1550-44cf-ba78-0c9da6ccbdad'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'fcf6e107-c711-49a1-85db-cdea5f387b0e'::uuid]),
       ('89371530-8323-44ad-bfc3-fe930bdcd82d'::uuid, 'kvadroStrong', 'Квадро Стронг',
        E'\nТкань, фурнитура, наполнители:\n - ткань прошита армированными нитями\n - матрас наполнен гипоаллергенным и антибактериальным холлофайбером.\n - водоотталкивающая ткань\n\nХарактеристики: \n - лежак не боится воды\n - аккуратные, мягкие бортики, на которые любимец может положить голову\n - чехол, который можно стирать в стиральной машине\n - съемная подушка\n',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, '7c417fc3-f2e6-47b8-a9b3-bd1bc366ba07'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'a04a122d-d2e7-4b64-97f1-4a6798b0b247'::uuid]),
       ('1dd21c67-e209-4599-b320-8bffb90f42ea'::uuid, 'lukoshkoDuo', 'Лукошко Дуо',
        E'\nТкань, фурнитура, наполнители:\n - ткань прошита армированными нитями\n - матрас наполнен гипоаллергенным и антибактериальным холлофайбером.\n - водоотталкивающая ткань\n\n\n«Лукошко» сшито из ткани со специальной водоотталкивающей пропиткой: влага скатывается и легко встряхивается с этого материала. ⠀\nМы любим ее за бархатную обработку материала и воздушное наполнение.\nМатериал имеет такое плотное переплетение, что даже острую, как елочные иголочки шерсть, можно стряхнуть одним движением. Это же свойство делает ткань очень крепкой и износостойкой. Лежаночка имеет съемный чехол на подушечку, который можно стирать в машинке.\n',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, '82a012b6-7ab0-4716-86d4-cac649e929c8'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'fcf6e107-c711-49a1-85db-cdea5f387b0e'::uuid]),
       ('b3b6b9e7-7686-479a-a3a3-2c640bd2d26c'::uuid, 'lukoshkoTrio', 'Лукошко Трио',
        E'\nТкань, фурнитура, наполнители:\n - ткань прошита армированными нитями\n - матрас наполнен гипоаллергенным и антибактериальным холлофайбером.\n - водоотталкивающая ткань\n\n\n«Лукошко» сшито из ткани со специальной водоотталкивающей пропиткой: влага скатывается и легко встряхивается с этого материала. ⠀\nМы любим ее за бархатную обработку материала и воздушное наполнение.\nМатериал имеет такое плотное переплетение, что даже острую, как елочные иголочки шерсть, можно стряхнуть одним движением. Это же свойство делает ткань очень крепкой и износостойкой. Лежаночка имеет съемный чехол на подушечку, который можно стирать в машинке.\n',
        '6da46c67-d6ed-4324-bf38-032e3a20d485'::uuid, 'c5f67952-265b-426c-84b4-4c8aa13a97cb'::uuid,
        ARRAY ['8959d0c0-4105-4f17-a3f1-b75fcf1cfe9d'::uuid, 'fcf6e107-c711-49a1-85db-cdea5f387b0e'::uuid]);

